(window.webpackJsonp=window.webpackJsonp||[]).push([[5],{35:function(o){o.exports={data:{blogPost:{title:"สวัสดีชาวโลกกก V2",date:"9 February, 2019",content:"<p>คือเรื่องของเรื่องก็คืออยู่ๆรู้สึกว่าอีตัว firebase &#x26; flamelink มันเริ่มไม่ตอบโจทย์ด้วยเรื่องตัว editor ของเพราะด้วยความที่ว่ามันมี error เยอะมากและทาง flamelink ก็ไม่แก้ไขให้ผมสักที ก็ได้แค่รอร๊อรอ จนในที่สุดก็ตัดใจว่า ไปเขียน markdown ก็ได้ฟ๊ะแต่ด้วยความที่ตัวเองไม่ถนัด markdown อย่าเรียกว่าไม่ถนัดสิต้องเรียกเข้าั้นโง่ markdown มากๆเพราะไม่เคยใช้เลยจะไปเขียนใน atom editor ก็ช้าแล้วจะใช้อะไรดีล่ะ นั้นก็คือ boostnote.io นั้นเองมันมาช่วยให้ผมมีความรู้สึกอยากเขียน note มากขึ้น~ ที่จริงไม่เกี่ยวหรอกแค่อยากจะแยก markdown note ออกมาแค่นั้นฮ่าๆๆๆ ถ้าไปเขียน markdown ใน atom editor มันรู้สึกเหมือนตัวเองเขียนโค๊ดก็เลยคิดว่าถ้ามีเวลามาเขียน blog คงมาเขียนใน boostnote แทน ผมหมดเรื่องจะบ่นแล้วง๊าาาา~ ของจบเลยก็แล้วกันนะครับ ชะแว๊บบบบบบ</p>\n",image:{type:"image",mimeType:"image/jpeg",src:"https://i.imgur.com/4X28DdS.jpg"},author:"Tar Jarupong"}}}}}]);